    super(props);
  }
  render(){
    return (
      <div className = "background">
        <Heatmap/>
        <ShipSelector title="Dropdown Menu" options={['Apple', 'Orange', 'Pear', 'Mango']}/>
    </div>
    )
  }
}
export default App;
